import { connect } from 'react-redux'

import DropDowm from '../../components/commom/DropDowm'
import { setDropDowmValue } from '../../redux/actions/dropDowm'


// function a(state){
//   return {
//     dropDowm:state.dropDowm
//   }
// }
function b(dispatch) {
  return {
    setDropDowmValue: (data) => { dispatch(setDropDowmValue(data)) }
  }
}

export default connect(state => ({ dropDowm: state.dropDowm }), b)(DropDowm)
